Een verhaal dat zich afspeelt in het jaar 2020, waar robotboksen een populaire sport is. Een promotor (Hugh Jackman) die moeite 
heeft zijn hoofd boven water te houden stuit op een afgeschreven robot en denkt er een kampioen van te kunnen maken. Terwijl hij 
samen met de robot furore maakt, komt hij erachter dat hij een zoontje van elf jaar oud heeft, die hem wil leren kennen.
